import React from "react";
import Post from "./Post";

const PostsList = posts => {
  return (
    <div>
      {posts.length === 0 && <div>Loading...</div>}
      <ul>
        {posts.map(post => (
          <Post />
        ))}
      </ul>
    </div>
  );
};

export default PostsList;
